import React from 'react';
import { Text, StyleSheet,View, Button, Image} from "react-native";



const image = { uri: "https://gifman.net/wp-content/uploads/2019/06/ursinhos-fofos-coracoes.gif" }

export default function Dados({navigation}){
    return (
        <View>
           
            <Text>Bem Vindo a sua conta SoulMili</Text>
            <Image source={image} resizeMode="cover" style={{height:150, width:150}}/>       
            <Button title="Ir para Produto"
                onPress={() => navigation.navigate('Produtos')}/> 
        </View>
    )
}
